import React, { Component } from 'react';
import portrait from '../img/headshot_small.jpg'
import "../style.css"

class NavBar extends Component {
    state = {  }
    render() { 
        return ( 
            <div class="col-lg-4">
                <img src={portrait} className="portrait-img" alt="Portrait shot"></img>
            </div>
            

         );
    }
}
 
export default NavBar;
